import axios from 'axios';

export function getParkings(location) {
    const params = {
        limit: 6,
        term: 'parking',
        location: location,
        offset: 0,
    }
    return (dispatch) => {
        return axios.get("https://api.yelp.com/v3/businesses/search", {
                params: params
            }, {
                headers: {
                    'Authorization': 'Bearer ' + process.env.REACT_APP_API_KEY
                }
            })
            .then(res => res.data)
            .then(res => console.log(res))
            .then(res => {
                dispatch({
                    type: 'GET_BUSINESS',
                    payload: res.data
                })
            })
            .catch(e => console.error(e))
    }
}
